column5:
- Giải quyết nhu cầu cấp thiết về đất ở, từng bước hoàn thiện hạ tầng bảo đảm xã Nhơn Hải đạt các tiêu chuẩn của phường nội thành trong thời gian tới;
- Chỉnh trang đô thị, kết nối và hoàn thiện hệ thống hạ tầng kỹ thuật khu vực và phát triển khu dân cư với khu dân cư hiện trạng. Tạo quỹ đất ở để đấu giá quyền sử dụng đất tạo nguồn thu cho ngân sách nhà nước và quỹ đất ở để bố trí tái định cư cho các dự án;
- Làm cơ sở pháp lý trong công tác quản lý xây dựng và quản lý đất đai.

